column4:
Participar da 3ª sessão ordinária do Conselho de Ensino, Pesquisa e Extensão - CONSEPE, que será realizada no dia 15 DE MARÇO DE 2016, às 9h, na SALA DE REUNIÕES DOS COLEGIADOS SUPERIOR, Prédio da Reitoria;
Participar da reunião da Comissão Permanente de Desenvolvimento Institucional - CPDI, que ocorrerá no dia 16/03/16, às 14h30min, na Sala dos Colegiados Superiores, Prédio da Reitoria; e
Participar de reunião com o Pró-reitor de Pós-graduação para tratar da proposta do Mestrado em Ensino de Línguas Estrangeiras, na Pró-reitoria de Pós-graduação, no dia 17 de março, às 10:00h.

Fazer cobertura para divulgação institucional das comemorações dos dois anos da instalação da Escola Multicampi de Ciências Médicas da UFRN em Caicó, RN, conforme programação:- Recepção dos estudantes da IIIª turma do Curso de Medicina Multicampi;

- Comemoração dos 02 anos de inauguração da EMCM/UFRN; 

- Ações culturais na Casa de Cultura Popular de Caicó, a partir das 19 horas. No local os estudantes, técnicos e docentes da EMCM participarão de um conjunto de atividades artísticas e culturais, celebrando os 02 anos do Curso com a comunidade caicoense.

09/08/16 - Participação na CLIV Reunião Ordinária da ANDIFES; 
10/08/2016 - Audiências com o Presidente da CAPES e com o Ministro da Educação; audiência com o Ministro da Saúde, Sr. Ricardo Barros, às 18:20.
11/08/2016 - Retorno a Natal

1. Participação na reunião da Diretoria Executiva da Andifes;
2. Participação na Solenidade de Lançamento do Projeto Piloto de Implementação do Programa Paulo Freire de Mobilidade Acadêmica para Estudantes de Programas Universitários de Formação de Professores;
3. Reunião com a Bancada Parlamentar do RN;
4. Audiência com o prof. Álvaro Prata - Secretário de Desenvolvimento Tecnológico e Inovação do Ministério da Ciência, Tecnologia, Inovações e Comunicações/SETEC/MCTIC;
5. Audiência da Diretoria Executiva da Andifes com o Exmo. Ministro da Educação - MEC, Sr. Mendonça Filho

Atividade de Campo: Dia:03/11/2016
Deslocamento de Natal para ministrar aulas de campo em João Pessoa, Goiana, Olinda-Recife - Pernambuco;
Dia: 04/11/2016
Aula de campo em Gravatá, Bezerros e Santa do Capibaribe - Pernambuco;
Dia: 05/11/2016
Aula de campo em Caruaru, especificamente, no distrito produtor de cerâmica, área urbana/organização espacial de Caruaru e a a Feira de Caruaru.
